    "contracts/pagosAutomConRecompra.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

// Importing various external libraries and interfaces
import "hardhat/console.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./SharesVault.sol";
import "./IOracle.sol";
import "./IMaster.sol";
import "./IERC20Snapshot.sol";

// Imports for token swapping via Uniswap
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Pair.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";

/// @title PagosAutomConRecompra
/// @notice A contract that connects to a sharesVault, the amt liquidity pool and the master contracts. recives BTCB and allows an administrative wallet to execute deposits to the sharesVault, swap BTCB for AMT on the liquidity pool and charges benefits from the master contract for the holded AMT.
/// @dev This contract is inheriting from the OpenZeppelin's Ownable contract, meaning it has a an owner, who has special privileges.
contract PagosAutomConRecompra is Ownable {
    // Events to emit on certain contract interactions
    event depositMade(uint256 amount);
    event swapMade(uint256 amtRecived, bool isFromRentabilidad);
    event charged(uint256 snap, uint256 amount);

    // Constant addresses for some deployed contracts
    address constant addrRouter = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
    address constant addrOracle = 0xaaE4ED197577c904BB0986cB562BA4395a8cbaf3;
    address constant addrMaster = 0x13e98112e1c67DbE684adf3Aeb1C871F1fe6D1Ac;
    address constant addrAmt = 0x6Ae0A238a6f51Df8eEe084B1756A54dD8a8E85d3;
    address constant addrBtcb = 0x7130d2A12B9BCbFAe4f2634d864A1Ee1Ce3Ead9c;
    address[] path;

    // Initializing contract interfaces
    IOracle constant oracle = IOracle(addrOracle);
    IERC20 constant amt = IERC20(addrAmt);
    IERC20 constant btcb = IERC20(addrBtcb);
    IMaster constant master = IMaster(addrMaster);
    SharesVault immutable sharesVault;
    uint256 public slippage; // slipagge = 1 eq 0.1%
    IUniswapV2Router02 constant router = IUniswapV2Router02(addrRouter);
    uint256 constant amountToApprove= 99999999999 * (10 ** 18);
    // The address of the administrative wallet that is allowed to execute swaps and deposits
    address public addrAdministrativeWallet;

    /// @notice Constructor to set up some initial contract configurations
    /// @param _sharesVault The address of the SharesVault contract
    constructor(address _sharesVault) {
        sharesVault = SharesVault(_sharesVault);
        // Granting approval to certain addresses for transferring an unlimited amount of btcb tokens on behalf of this contract.
        btcb.approve(_sharesVault, amountToApprove);
        btcb.approve(addrRouter, amountToApprove);
        slippage = 10; // 1%
    }

    /// @notice Allows owner to extend approval for BTCB to a new address
    /// @param addrToApprove The address to approve for BTCB transfer
    function extendApprove(address addrToApprove) public onlyOwner {
        btcb.approve(addrToApprove, amountToApprove);
    }

    /// @notice Sets a new administrative wallet
    /// @param newAdministrativeWallet The address of the new administrative wallet
    function setAdministrativeWallet(
        address newAdministrativeWallet
    ) public onlyOwner {
        addrAdministrativeWallet = newAdministrativeWallet;
    }

    /// @notice Admin sets new slippage
    /// @param newSlippage the new slippage to be setted
    function setSlippage(uint256 newSlippage) public onlyOwner {
        require(slippage <= 1000, "slippage can not be bigger than 1000");
        slippage = newSlippage;
    }

    /// @notice Makes a deposit to the SharesVault contract
    /// @param amount The amount to deposit
    /// @return Returns the amount deposited
    function deposit(uint256 amount) public returns (uint256) {
        require(
            msg.sender == addrAdministrativeWallet,
            "Wallet not allowed to execute deposit"
        );
        sharesVault.deposit(amount);
        emit depositMade(amount);
        return amount;
    }

    /// @notice Performs a swap of tokens using Uniswap
    /// @param amountBtcb The amount of Btcb tokens to swap
    /// @param isFromRentabilidad A boolean indicating if the swap is done with btc generated by rentability
    /// @return Returns the amount of tokens received after the swap
    function swap(
        uint256 amountBtcb,
        bool isFromRentabilidad
    ) public returns (uint256) {
        require(
            msg.sender == addrAdministrativeWallet,
            "Wallet not allowed to execute swap"
        );
        uint256 amountAMT = oracle.consult(addrBtcb, amountBtcb);
        uint256 minAmountAMTToRecive = (amountAMT * (1000 - slippage)) / 1000;

        path = [addrBtcb, addrAmt];

        uint256 amtRecived = router.swapExactTokensForTokens(
            amountBtcb,
            minAmountAMTToRecive,
            path,
            address(this),
            block.timestamp + 600
        )[1];
        emit swapMade(amtRecived, isFromRentabilidad);
        return amtRecived;
    }

    /// @notice Charges a certain amount of tokens
    /// @param snapId The ID of the snapshot
    /// @return Returns the amount of tokens charged
    function charge(uint256 snapId) public returns (uint256) {
        require(
            msg.sender == addrAdministrativeWallet,
            "Wallet not allowed to execute charge"
        );
        uint256 chargedAmount = master.charge(snapId);

        emit charged(snapId, chargedAmount);
        return chargedAmount;
    }

    /// @notice Allows owner to withdraw all AMT and BTCB tokens from the contract
    function withdrawAll() public onlyOwner {
        bool amtTransferSucceded =  amt.transfer(msg.sender, amt.balanceOf(address(this)));
        require(amtTransferSucceded, "Transaction error");
        bool btcbTransferSucceded = btcb.transfer(msg.sender, btcb.balanceOf(address(this)));
        require(btcbTransferSucceded, "Transaction error");
    }
}
"
    },
    "contracts/SharesVault.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

// Importing necessary OpenZeppelin interfaces
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/// @title SharesVault
/// @notice This contract serves as a secure vault for BTCB tokens acting as a bridge between an external payment system and the beneficiary. The contract allows an administrator, set during contract deployment, to deposit BTCB tokens into the contract as a form of payment from an external system. Simultaneously, a specified beneficiary is granted exclusive permission to withdraw these deposited tokens as their form of received payment.
/// @dev Inherits from the Ownable contract of the OpenZeppelin library
contract SharesVault is Ownable {
    // Reference to the ERC20 token contract
    IERC20 public btcb;

    // Mapping of addresses to the number of shares they own
    mapping(address => uint256) public shares;

    // Address authorized to make deposits
    address public addrDepositMaker;

    // Address to receive withdrawals
    address public beneficiary;

    // Constant address of the BTCB token contract
    address constant addrBtcb = 0x7130d2A12B9BCbFAe4f2634d864A1Ee1Ce3Ead9c;

    /// @notice The contract constructor
    /// @param _beneficiary The address that can withdraw tokens from this contract
    constructor(address _beneficiary) {
        btcb = IERC20(addrBtcb);
        addrDepositMaker = msg.sender;
        beneficiary = _beneficiary;
    }

    /// @notice Changes the address authorized to deposit tokens
    /// @param newDepositMaker The new deposit maker's address
    function setDepositMaker(address newDepositMaker) public onlyOwner {
        addrDepositMaker = newDepositMaker;
    }

    /// @notice Changes the beneficiary's address
    /// @param newBeneficiary The new beneficiary's address
    function changeBeneficiary(address newBeneficiary) public {
        require(msg.sender == beneficiary, "Not allowed to change beneficiary");
        beneficiary = newBeneficiary;
    }

    /// @notice Deposits a certain amount of BTCB tokens into the contract
    /// @param amount The amount of tokens to deposit
    function deposit(uint amount) public {
        require(msg.sender == addrDepositMaker, "Not allowed to deposit");
        bool transferSucceded = btcb.transferFrom(msg.sender, address(this), amount);
        require(transferSucceded, "Transaction error");
    }

    /// @notice Withdraws all BTCB tokens from the contract
    function withdraw() public {
        require(msg.sender == beneficiary, "Not allowed to withdraw");
        uint256 balance = btcb.balanceOf(address(this));
        bool transferSucceded = btcb.transfer(beneficiary, balance);
        require(transferSucceded, "Transaction error");
    }
}"
